// random byte between (a ... b-1)
// use rand() because rand8() has a cycle of 255
byte rndint(byte a, byte b) {
  return (rand() % (b-a)) + a;
}

// function to write a string into the name table
//   adr = start address in name table
//   str = pointer to string
void put_str(unsigned int adr, const char *str) {
  vram_adr(adr);        // set PPU read/write address
  vram_write(str, strlen(str)); // write bytes to PPU
}

void move_actors() {
  char pad;
  byte runseq;
  //set player 0/1 velocity based on controller
  pad = pad_poll(0);
  // move player up
  if (pad&PAD_A && actor_y[0]>7) {
    oam_id = oam_meta_spr(actor_x[0], actor_y[0], oam_id, playerFly);
    actor_dy[0]=-2;
  } // move player down
  else if (actor_y[0]<190) {
    actor_dy[0]=2;
    oam_id = oam_meta_spr(actor_x[0], actor_y[0], oam_id, playerRun1);
  } // keep player on ground
  else { 
    actor_dy[0]=0;
    // run sequence
    runseq = (tic % 18)/6;
    oam_id = oam_meta_spr(actor_x[0], actor_y[0], oam_id, playerRunSeq[runseq]);
  }
  // update player's location
  actor_x[0] += actor_dx[0];
  actor_y[0] += actor_dy[0];
  
  //draw and move stars
  for (i=1; i<MAX_STARS; i++) {
    oam_id = oam_spr(stars_x[i], stars_y[i], 0x18, i, oam_id);
    if (stars_x[i]>0)  stars_x[i] += stars_dx[i];
  }  
  //draw and move pokeballs
  for (i=1; i<6; i++) {
    oam_id = oam_spr(actor_x[i], actor_y[i], 0x90,2, oam_id);
    if (actor_x[i]>0)  actor_x[i] += actor_dx[i];
    actor_y[i] += actor_dy[i];
  }
  //draw and move dragons
  for (i=6; i<8; i++) {
    oam_id = oam_meta_spr(actor_x[i], actor_y[i], oam_id, enemyDragon);
    if (actor_x[i]>0)  actor_x[i] += actor_dx[i];
    actor_y[i] += actor_dy[i];    
  } 
  // hide other sprites if oam_id not wrapped to 0
  if (oam_id!=0) oam_hide_rest(oam_id);
} 

void dead_player() {
  if (actor_y[0]<192) { // player falls to the ground
    actor_dy[0]=1;
    oam_clear();
    oam_id = oam_meta_spr(actor_x[0], actor_y[0], oam_id, playerDead);
  }
  else {
    actor_dy[0]=0;
    oam_id = oam_meta_spr(actor_x[0], actor_y[0], oam_id, playerDead);
  }
  // update player's location
  actor_x[0] += actor_dx[0];
  actor_y[0] += actor_dy[0];
   
  // hide other sprites if oam_id not wrapped to 0
  if (oam_id!=0) oam_hide_rest(oam_id);
} 

void initialize_player() {
  actor_x[0] = 30;
  actor_y[0] = 192;
  actor_dx[0] = 0;
  actor_dy[0] = 0; 
}

void initialize_dragon1() {
  actor_x[6] = 180;
  actor_y[6] = rndint(40,100);
  actor_dx[6] = -2;
  actor_dy[6] = 0;
}

void initialize_dragon2() {
  actor_x[7] = 200;
  actor_y[7] = rndint(110,180);
  actor_dx[7] = -2;
  actor_dy[7] = 0;
}

void initialize_stars() {
  for (i=0; i<MAX_STARS; i++) {
    stars_x[i] = rand();
    stars_y[i] = rndint(10,60);
    stars_dx[i] = -1;
  }
}

void initialize_coins() { 
  int rand = rndint(1,6);
  
  if (rand==1){
    actor_x[1] = 180;
    actor_y[1] = rndint(90,180);
    actor_dx[1] = -1;
    actor_dy[1] = 0;
    for (i=2; i<6; i++) { 
      actor_x[i] = actor_x[i-1]+10;
      actor_y[i] = actor_y[i-1]-9;
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
  }
  else if (rand==2){
    actor_x[1] = 200;
    actor_y[1] = rndint(20,180);
    actor_dx[1] = -1;  
    actor_dy[1] = 0;
    for (i=2; i<6; i++) { 
      actor_x[i] = actor_x[i-1]+10;
      actor_y[i] = actor_y[i-1]+9;
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
  }
  else if (rand==3){
    actor_x[1] = 200;
    actor_y[1] = rndint(20,180);
    actor_dx[1] = -1;  
    actor_dy[1] = 0;
    for (i=2; i<4; i++) { 
      actor_x[i] = actor_x[i-1]+10;
      actor_y[i] = actor_y[i-1]+10;
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
    for (i=4; i<6; i++) { 
      actor_x[i] = actor_x[i-1]+10;
      actor_y[i] = actor_y[i-1]-10;
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
  }
  else if (rand==4){
    actor_x[1] = 200;
    actor_y[1] = rndint(20,150);
    actor_dx[1] = -1;  
    actor_dy[1] = 0;
    for (i=2; i<4   ; i++) { 
      actor_x[i] = actor_x[i-1]+9;
      actor_y[i] = actor_y[i-1]-9;
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
    for (i=4; i<6; i++) { 
      actor_x[i] = actor_x[i-1]+9;
      actor_y[i] = actor_y[i-1]+9;
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
  }
  else if (rand==5){
    actor_x[1] = 200;
    actor_y[1] = rndint(20,150);
    actor_dx[1] = -1;  
    actor_dy[1] = 0;
    
    actor_x[2] = actor_x[1]+10;
    actor_y[2] = actor_y[1]+5;     
    actor_x[3] = actor_x[2]+10;
    actor_y[3] = actor_y[2]-5;      
    actor_x[4] = actor_x[3]+10;
    actor_y[4] = actor_y[3]+5;       
    actor_x[5] = actor_x[4]+10;
    actor_y[5] = actor_y[4]-5;        
    for (i=2; i<5; i++) { 
      actor_dx[i] = -1;
      actor_dy[i] = 0;
    }
  } 
}

// change the background color when a new game starts
void change_backgroundcolor() {
    if (gamecount%11 == 0) pal_col(0, 0xAF);
    else if (gamecount%11 == 1) pal_col(0, 0xEA);
    else if (gamecount%11 == 2) pal_col(0, 0xD8);
    else if (gamecount%11 == 3) pal_col(0, 0xEE);
    else if (gamecount%11 == 4) pal_col(0, 0xAF);   
    else if (gamecount%11 == 5) pal_col(0, 0xE1);
    else if (gamecount%11 == 6) pal_col(0, 0xEE);
    else if (gamecount%11 == 7) pal_col(0, 0xAF);     
    else if (gamecount%11 == 8) pal_col(0, 0x21);   
    else if (gamecount%11 == 9) pal_col(0, 0xEB);   
    else if (gamecount%11 == 10) pal_col(0, 0xD8);        
    else if (gamecount%11 == 11) pal_col(0, 0xBC);        
    else if (gamecount%11 == 12) pal_col(0, 0xD);
    else pal_col(0, 0xD);
}

