// game over loop
void game_over() {
  ppu_off();
  vram_adr(NTADR_A(5,13));
  vram_write("PRESS ENTER TO RESTART", 22);
  ppu_on_all();
  gamecount += 1;
  if (score>best_score) best_score=score;
  while (1) {
    char pad;
    oam_id = 4;
    pad = pad_trigger(0);
    dead_player();
    score = 0;
    if (pad&PAD_START) break;
    ppu_wait_frame();
  }
  // clear the reset message when the new game is started
  ppu_off();
  vram_adr(NTADR_A(5,13));
  vram_write("                      ", 22);
  
  // change background color
  change_backgroundcolor(); 
  ppu_on_all();
  actor_y[0]=192;
} 

void draw_score() {
  oam_id = oam_spr(64+0, 15, '0'+(score >> 8), 4, oam_id);
  oam_id = oam_spr(64+8, 15, '0'+(score >> 4 & 0xf), 4, oam_id);
  oam_id = oam_spr(64+16, 15, '0'+(score & 0xf),4, oam_id);
}

void draw_best_score() {
  oam_id = oam_spr(215+0, 15, '0'+(best_score >> 8), 4, oam_id);
  oam_id = oam_spr(215+8, 15, '0'+(best_score >> 4 & 0xf), 4, oam_id);
  oam_id = oam_spr(215+16, 15, '0'+(best_score & 0xf),4, oam_id);
}

// if player gets coin
void coin_collision() {
  for (i=1; i<6; i++){
    if (actor_x[0] >= actor_x[i]-5 && actor_x[0]<=actor_x[i]+5 && actor_y[0]+9 >= actor_y[i]-6 && actor_y[0] <= actor_y[i]+5){
      score = bcd_add(score, 1); //increase score  
      actor_y[i] = 250; // remove coin from screen to avoid false collision
    };
  }
}

byte dragon_collision() {
  for (i=6; i<8; i++){
    if (actor_x[0] >= actor_x[i]-5 && actor_x[0]<=actor_x[i]+30 && actor_y[0] >= actor_y[i]-5 && actor_y[0] <= actor_y[i]+15){ 
      // remove dragons if touched to avoid false collision after dying
      actor_y[6] = 230; 
      actor_y[7] = 240; 
      return 0;
    };
  }
  return 1;
}

// main game loop
void play_game() {
  int x = 0;   // y scroll position
  int dx = 1;  // x scroll direction
  // infinite loop
  while (1) {
    while (1) {
      tic += 1; // increments frame count
      if (!music_ptr) start_music(music1);
      play_music();
    
      oam_id = 4;
      oam_spr(0,25,0xa0,0,0);    

      // wait for next frame
      if (actor_x[5]<5) initialize_coins();
      if (actor_x[6]<1) initialize_dragon1();
      if (actor_x[7]<1) initialize_dragon2();
      if (stars_x[4]<1) initialize_stars();
      vrambuf_clear();
      move_actors(); 
      draw_score();
      draw_best_score();
      coin_collision();
    
      x += dx; // update x variable
      split(x, 16); // set scroll register     
      if (dragon_collision()==0) break;   
    }
    game_over();
  }
}

